import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import {PaddedTableCell} from "../../styling/StyledComponents";
import * as React from "react";


const TableHeadWithoutSort = () => {

    return(
        <TableHead>
            <TableRow>
                <PaddedTableCell>
                        Movie
                </PaddedTableCell>
                <PaddedTableCell
                    align="left"
                >
                        Rating
                </PaddedTableCell>
                <PaddedTableCell align="left">Runtime</PaddedTableCell>
            </TableRow>
        </TableHead>
    )}

export default TableHeadWithoutSort;
